window.bookSummaryJSON = "<p>When Charlotte Sawyer is unable to contact her step-sister, Jocelyn, to tell her that one her closest friends was found dead, she discovers that Jocelyn has vanished. </p> <p>Beautiful, brilliant - and reckless - Jocelyn has gone off the grid before, but never like this. In a desperate effort to find her, Charlotte joins forces with Max Cutler, a struggling PI who recently moved to Seattle after his previous career as a criminal profiler went down in flames - literally. Burned out, divorced and almost broke, Max needs the job. </p> <p>After surviving a near-fatal attack, Charlotte and Max turn to Jocelyn's closest friends, women in a Seattle-based online investment club, for answers. But what they find is chilling. When her uneasy alliance with Max turns into a full-blown affair, Charlotte has no choice but to trust him with her life. For the shadows of Jocelyn's past are threatening to consume her - and anyone else who gets in their way. </p>"; 
